(1, 'terms_and_conditions', '<p>Introduction</p>\r\n\r\n<p>Welcome to BROBO. Our website provides you with a seamless rental experience, and by using our service, you are agreeing to comply with and be bound by the following terms and conditions of use, which, together with our privacy policy, govern BROBO&rsquo;s relationship with you in relation to this website.</p>\r\n\r\n<p>Acceptance of Terms</p>\r\n\r\n<p>By accessing the content of BROBO (&quot;the Website&quot;), you agree to the terms and conditions set out herein and accept our Privacy Policy. If you do not agree to any of the terms and conditions you should not continue to use the Website.</p>\r\n\r\n<p>Service Description</p>\r\n\r\n<p>BROBO provides an online marketplace platform allowing you to rent various items. By using the Website, you acknowledge that you are engaging in our Service and agree to be bound by these Terms, including any additional terms and policies referenced herein.</p>\r\n\r\n<p>Eligibility</p>\r\n\r\n<p>You must be at least the age of majority in your jurisdiction to use our Website. By using BROBO, you represent that you have the authority to bind yourself or the entity you represent to these Terms of Service.</p>\r\n\r\n<p>User Conduct</p>\r\n\r\n<p>You agree to use the Website only for lawful purposes and in a manner that does not infringe the rights of, restrict, or inhibit anyone else&#39;s use and enjoyment of the Website.</p>\r\n\r\n<p>Intellectual Property Rights</p>\r\n\r\n<p>The intellectual property rights in all content and material on the Website are owned by BROBO and must not be reproduced without our prior consent.</p>\r\n\r\n<p>Modifications to the Service</p>\r\n\r\n<p>BROBO reserves the right to modify or discontinue the Service with or without notice to you. We shall not be liable to you or any third party should we exercise our right to modify or discontinue the Service.</p>\r\n\r\n<p>Products and Services</p>\r\n\r\n<p>All products or services made available through BROBO are intended for rental only, subject to availability. We reserve the right to limit the quantities of any products or services that we offer.</p>\r\n\r\n<p>User Accounts</p>\r\n\r\n<p>When you create an account with us, you must provide us with information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the Terms.</p>\r\n\r\n<p>Accuracy of Billing and Account Information</p>\r\n\r\n<p>We reserve the right to refuse any order you place with us. You agree to provide current, complete, and accurate purchase and account information for all rentals made at our store.</p>\r\n\r\n<p>Optional Tools</p>\r\n\r\n<p>Any use by you of optional tools offered through the Website is entirely at your own risk and discretion.</p>\r\n\r\n<p>Third-Party Links</p>\r\n\r\n<p>Third-party links on our site may direct you to third-party websites that are not affiliated with us. We are not liable for examining or evaluating the content or accuracy of these sites.</p>\r\n\r\n<p>Personal Information</p>\r\n\r\n<p>Your submission of personal information through the store is governed by our Privacy Policy.</p>\r\n\r\n<p>Errors, Inaccuracies, and Omissions</p>\r\n\r\n<p>Occasionally there may be information on our site that contains typographical errors, inaccuracies, or omissions. We reserve the right to correct any errors, inaccuracies, or omissions, and to change or update information if any information is inaccurate at any time without prior notice.</p>\r\n\r\n<p><br />\r\nProhibited Uses</p>\r\n\r\n<p>In addition to other prohibitions as set forth in the Terms of Service, you are prohibited from using the site or its content for any unlawful purpose.</p>\r\n\r\n<p>Disclaimer of Warranties; Limitation of Liability</p>\r\n\r\n<p><br />\r\nWe do not guarantee that the results obtained from the use of the service will be accurate or reliable.</p>\r\n\r\n<p>Indemnification</p>\r\n\r\n<p>You agree to indemnify, defend, and hold harmless BROBO and our affiliates, partners, officers, directors, agents, contractors, licensors, service providers, subcontractors, suppliers, interns, and employees, harmless from any claim or demand.</p>\r\n\r\n<p>Severability</p>\r\n\r\n<p>In the event that any provision of these Terms of Service is determined to be unlawful, void, or unenforceable, such provision shall nonetheless be enforceable to the fullest extent permitted by applicable law.</p>\r\n\r\n<p>Termination</p>\r\n\r\n<p>The obligations and liabilities of the parties incurred prior to the termination date shall survive the termination of this agreement for all purposes.</p>\r\n\r\n<p>Governing Law</p>\r\n\r\n<p>These Terms of Service shall be governed by and interpreted in accordance with the laws of India.</p>\r\n\r\n<p>Contact Information</p>\r\n\r\n<p>Questions about the Terms of Service should be sent to us at broboyouchoose@gmail.com</p>', NULL, '2024-02-21 11:17:44'),
(3, 'about_us', '<p>Established in 2022 in Bangalore, BROBO has quickly become a trusted name in the rental marketplace for event-related materials, including tents, chairs, beds, and more. Our mission is to streamline the traditional tent house and flower d&eacute;cor industries, making it easier for small and medium businesses across India to access the services they need.</p>\r\n\r\n<p>At BROBO, we believe in simplifying event planning through our easy-to-use online platform, offering a wide range of quality tent house services and flower d&eacute;cor options. Our aim is to help you plan your events, from grand weddings to cozy family gatherings, with confidence and ease. Every item in our catalog is selected to meet our high standards of quality and design.</p>\r\n\r\n<p>We&rsquo;re committed to transparency and trust. Our platform ensures a seamless browsing experience, backed by 100% payment security. We want our customers to feel secure in their transactions, knowing that integrity is at the heart of everything we do.</p>\r\n\r\n<p>Understanding the importance of affordability, we&rsquo;ve tailored our business model to suit the Indian market, ensuring our services are both high-quality and competitively priced. At BROBO, we want to make your dream events come true, without the added financial pressure.</p>\r\n\r\n<p>As we continue to grow, BROBO remains focused on innovation and customer satisfaction, redefining event planning in India. We&rsquo;re here to help you create lasting memories, one event&nbsp;at&nbsp;a&nbsp;time.</p>', NULL, '2024-03-14 18:11:12'),
(4, 'privacy_policy', '<p>Our Commitment to Privacy</p>\r\n\r\n<p>BROBO values your privacy and is committed to protecting your personal data. This Privacy Policy outlines our practices for collecting, using, and safeguarding the information you provide to us via our Website.</p>\r\n\r\n<p>The Information We Collect</p>\r\n\r\n<p>This notice applies to all information collected or submitted on the BROBO website. On some pages, you can order products, make requests, and register to receive materials. The types of personal information collected at these pages are:</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Name</p>\r\n\r\n<p>Address</p>\r\n\r\n<p>Email address</p>\r\n\r\n<p>Phone number</p>\r\n\r\n<p>(etc.)</p>\r\n\r\n<p>How We Use Information</p>\r\n\r\n<p>We use the information you provide about yourself when placing an order only to complete that order. We do not share this information with outside parties except to the extent necessary to complete that order.</p>\r\n\r\n<p>We use return email addresses to answer the email we receive. Such addresses are not used for any other purpose and are not shared with outside parties.</p>\r\n\r\n<p>Finally, we never use or share the personally identifiable information provided to us online in ways unrelated to the ones described above without also providing you an opportunity to opt-out or otherwise prohibit such unrelated uses.</p>\r\n\r\n<p>Our Commitment to Data Security</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we have put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information we collect online.</p>\r\n\r\n<p>How You Can Access or Correct Your Information</p>\r\n\r\n<p>You can access all your personally identifiable information that we collect online and maintain by calling us or sending us an email. We use this procedure to better safeguard your information.</p>\r\n\r\n<p>How to Contact Us</p>\r\n\r\n<p>Should you have other questions or concerns about these privacy policies, please send us an email at broboyouchoose@gmail.com.</p>', NULL, '2024-02-21 11:19:30'),
