(65, 'returns_policy', '<p>At BROBO, your satisfaction is paramount when it comes to our rental services. Due to the unique nature of our offerings, we are unable to accept returns once an order is confirmed and the item has been dispatched. However, we are committed to addressing any issues with damaged items.</p>\r\n\r\n<p>In the unfortunate event that you receive a damaged item, please contact our customer service team within [24 Hours] of delivery, providing photographic evidence of the damage. We will confirm the damage and endeavour to arrange a replacement of the item, subject to availability, as quickly as possible at no extra charge.</p>', NULL, '2024-02-21 11:14:17'),
(66, 'replacement_policy', '<p>For any damaged items, please contact our customer service within 2 hours of receiving your order. Please note that we cannot process replacement requests or address concerns that are reported after 2 hours from the date of delivery confirmation.</p>', NULL, '2024-02-21 11:14:17'),
(67, 'cancellation_policy', '<p>We understand that your plans may change. Orders can be cancelled within 24 hours of placement, without incurring any penalties. To initiate a cancellation, please send an email to broboyouchoose@gmail.com including your order details.</p>\r\n\r\n<p>Refunds for cancelled orders will be processed expediently and returned to the original payment method within 5 to 10 business days.</p>', NULL, '2024-02-21 11:14:17'),
(68, 'shipping_policy', '<p><strong>Shipping Policy</strong></p>\r\n\r\n<p>At BROBO, we are dedicated to providing convenient and efficient delivery services for a wide range of rental items in Bengaluru. Our goal is to ensure a smooth rental experience by delivering the items you need directly to your location, quickly and safely.</p>\r\n\r\n<p><strong>Delivery Service:</strong></p>\r\n\r\n<p>Ensuring prompt delivery is our top commitment. Orders placed before 24 hours on business days are dispatched on the same day, allowing you to begin your rental period without delay. Orders received after the cut-off time will be processed and dispatched on the next business day.</p>\r\n\r\n<p><strong>Shipping Timeline:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Processing Time:</strong> Orders placed before the 24-hour cut-off time on business days are processed and dispatched on the same day. Orders received after the cut-off time will be processed and dispatched on the next business day.</li>\r\n	<li><strong>Delivery Time:</strong> Once dispatched, delivery times may vary depending on your location and the availability of the items. Typically, deliveries are completed within selected slot delivery time business days from the dispatch date.</li>\r\n</ul>\r\n\r\n<p>In the event of any unforeseen delays, we will immediately inform you and provide an updated delivery timeline.</p>\r\n\r\n<p><strong>Delivery Rates:</strong></p>\r\n\r\n<p>Our delivery rates are transparent and competitive, reflecting the order value of the items being rented:</p>\r\n\r\n<table border=\"1\" style=\"width:692px\">\r\n	<thead>\r\n		<tr>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p><strong>Order Value</strong></p>\r\n			</td>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p><strong>Delivery Charges</strong></p>\r\n			</td>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p>Rs 1500 to Rs 2500</p>\r\n			</td>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p>Rs 800</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p>Rs 2501 to Rs 4999</p>\r\n			</td>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p>Rs 1200</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p>Rs 5000 and above</p>\r\n			</td>\r\n			<td style=\"background-color:white; border-bottom:1px solid #e3e3e3; border-left:1px solid #e3e3e3; border-right:1px solid #e3e3e3; border-top:1px solid #e3e3e3; vertical-align:bottom\">\r\n			<p>Rs 2000</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>We utilize a combination of our own fleet and a network of trusted delivery partners to ensure your rental items arrive on time. While we make every effort to avoid delays, please understand that any issues beyond BROBO\'s control will be communicated to you as soon as possible.</p>\r\n\r\n<p><strong>Customer Support:</strong></p>\r\n\r\n<p>For any special delivery requests or additional support, our customer service team is on standby to provide assistance.</p>\r\n\r\n<p>Please be aware that delivery times can vary depending on the specific location and availability of the items.</p>\r\n\r\nDelivery start from 8am and end 11pm', NULL, '2024-03-17 12:10:56'),
