(173, 'Decoration', '<p>Add a touch of whimsy and charm to any room with our delightful Whimsical Floral Wall Art. Crafted with meticulous attention to detail, this hand-painted piece features a vibrant array of blooming flowers dancing across a serene backdrop. Each brushstroke captures the essence of nature&#39;s beauty, bringing a sense of freshness and vitality to your space.</p>\r\n\r\n<p>Measuring [dimensions], this artwork is the perfect focal point for your living room, bedroom, or office. Its cheerful palette of pastel hues effortlessly brightens any environment, creating a welcoming ambiance for you and your guests. Whether you&#39;re a nature enthusiast or simply appreciate artistic flair, our Whimsical Floral Wall Art is sure to elevate your d&eacute;cor with its timeless appeal.</p>', '2024-02-29-65e0534c985af.png', 43, '[{\"id\":\"2\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '200.00', '0.00', 'percent', '10.00', 'percent', '[]', '169', 'White', 1, '2024-02-29 15:20:04', '2024-03-27 18:05:27'),
(174, 'Flower blooming', '<p>This flower arrangement consists of roses, carnations and Helichrysum in soft shades of pink, yellow this express the purity of love.</p>', '2024-02-29-65e0572d3e62f.png', 36, '[{\"id\":\"2\",\"position\":1},{\"id\":\"36\",\"position\":2}]', '2500.00', '0.00', 'percent', '0.00', 'amount', '[\"2024-02-29-65e057504c155.png\",\"2024-02-29-65e0572d3d07f.png\"]', '-1', 'White', 1, '2024-02-29 15:36:37', '2024-03-13 11:20:20'),
(175, 'Heartfelt Harmony', '<p>The heart-shaped anthuriums and the harmonious combination of colors and textures in the bouquet.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Flowers Count: 16</p>\r\n\r\n<p>Flowers Type: Hydrangea, Anthuriums, Carnation and Snapdragon</p>\r\n\r\n<p>Color: Assorted</p>\r\n\r\n<p>Disclaimer: We attempt to create bouquets to look like on the picture but in certain conditions, we may need to make flower substitutions. Please be confident that we will make your flower arrangement look gorgeous.</p>', '2024-02-29-65e0581db6b66.png', 36, '[{\"id\":\"2\",\"position\":1},{\"id\":\"36\",\"position\":2}]', '2450.00', '0.00', 'percent', '0.00', 'amount', '[\"2024-02-29-65e0581db5bcf.png\"]', '20', 'White', 1, '2024-02-29 15:40:37', '2024-03-16 18:52:20'),
(176, 'Uniquely Yours', '<p>&ldquo;Elevate Your Love Story with &lsquo;Uniquely Yours&rsquo; &ndash; A Majestic Valentine&rsquo;s Flower Bouquet of 130 Red Roses, Exclusively from June Flowers!&rdquo;</p>', '2024-02-29-65e058a74c177.png', 36, '[{\"id\":\"2\",\"position\":1},{\"id\":\"36\",\"position\":2}]', '5999.00', '0.00', 'percent', '0.00', 'amount', '[]', '29', 'White', 1, '2024-02-29 15:42:55', '2024-03-21 11:33:46'),
(177, 'White orchid', '<p>White orchid , yellow rose petals, gypsy flowers with little green. Light weight and different model</p>\r\n\r\n<p>This South Indian wedding garland design features an exquisite combination of white orchids, yellow rose petals, gypsy flowers, and a touch of green foliage. Known for its elegance and uniqueness, this garland is crafted to be lightweight, making it comfortable for the couple to exchange during the wedding ceremony.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The blend of white orchids and vibrant yellow rose petals symbolizes purity and prosperity, while the gypsy flowers add a touch of charm. With its distinct model, this garland is sure to stand out and add a special touch to the wedding ceremony.</p>', '2024-02-29-65e05a3790407.png', 43, '[{\"id\":\"2\",\"position\":1},{\"id\":\"43\",\"position\":2}]', '3999.00', '0.00', 'percent', '0.00', 'amount', '[]', '0', 'White', 1, '2024-02-29 15:49:35', '2024-03-13 17:47:30'),
