(184, 'Cotton matters', '<ul>\r\n	<li>Premium Quality: Made with high-grade cotton, this mattress ensures durability and long-lasting comfort.</li>\r\n	<li>Generous Thickness: With a substantial thickness, this mattress offers ample cushioning for a cozy slumber.</li>\r\n	<li>Medium-Firm Comfort: Experience the ideal balance between softness and support, promoting a comfortable sleep posture.</li>\r\n	<li>Quilted Design: The intricate maroon embroidery adds a stylish flair to your bedroom while enhancing the mattress&#39;s visual appeal.</li>\r\n	<li>Single Bed Size: Designed to perfectly fit single beds (2X6 ft), making it an ideal choice for guest rooms, dorms, or compact spaces.</li>\r\n	<li>Breathable Material: The cotton construction allows for proper air circulation, keeping you cool and comfortable throughout the night.</li>\r\n</ul>', '2024-03-01-65e0cdb154755.png', 33, '[{\"id\":\"1\",\"position\":1},{\"id\":\"33\",\"position\":2}]', '150.00', '0.00', 'percent', '0.00', 'amount', '[\"2024-03-01-65e0cdb153724.png\"]', '499', 'White', 1, '2024-03-01 00:02:17', '2024-03-19 19:06:38'),
